import React, { useEffect, useState } from "react";
import "./Overview.css";
import Suggestion from "./Suggestion";
import Calories from "./Calories";
import Steps from "./Steps";
import Workout from "./Workout";
import Goals from "./Goals";

const Overview = () => {
  const [selectedComponent, setSelectedComponent] = useState();

  useEffect(() => {
    setSelectedComponent(<InfoPage setSelectedComponent={setSelectedComponent}/>);
  }, [])

  return <>{selectedComponent}</>;
};

export default Overview;

const InfoPage = ({setSelectedComponent}) => {
  return (
    <>
      <div className="info-page">
        <Suggestion />
        <div onClick={() => setSelectedComponent(<Goals />)}><Workout /></div>
        <Calories />
        <Steps />
        <div className="goal-process"></div>
      </div>
      <div className="schedule-page"></div>
    </>
  );
};
